def score(x, percentiles):
    i = 0
    while i < len(percentiles) and percentiles[i] <= x:
        i += 1
    return i

def standardize(scores):
    mean = numpy.mean(scores)
    s = numpy.std(scores)
    std = [(score - mean)/s for score in scores]
    std = [50 + 50 * (- min(std) + score) for score in std]
    return std

